class Solution {
  int minOperations(List<int> nums, int k) {
    // Reverse the nums list to simulate removing elements from the end
    nums = List.from(nums.reversed);
    // Use a set to keep track of collected elements
    final Set<int> collected = {};
    int operations = 0;
    // Iterate through the reversed list
    for (int num in nums) {
      collected.add(num); // Add current number to the collection
      operations++; // Increment the number of operations
      // Check if we have collected all elements from 1 to k
      if (collected.length >= k) {
        bool allCollected = true;
        for (int i = 1; i <= k; i++) {
          if (!collected.contains(i)) {
            allCollected = false;
            break;
          }
        }
        if (allCollected) {
          return operations; // Return the number of operations if all elements are collected
        }
      }
    }
    return operations; // Return the total number of operations if needed
  }
}
